/** Convert latitude/longitude to SVG x/y coordinates using Equirectangular projection. */
export function latLngToSvg(lat: number, lng: number): { x: number; y: number } {
  const x = ((lng + 180) / 360) * MAP_VIEWBOX.width;
  const y = ((90 - lat) / 180) * MAP_VIEWBOX.height;
  return { x, y };
}
